export default class Currency {
  constructor(code, name) {
    this._name = name;
    this._code = code;
  }

  get name (){
    return this._name;
  }

  get code() {
    return this._code;
  }

  set name(newName) {
    this._name = newName;
 }

  set code(newCode) {
    this._code = newCode;
  }

  displayFullCurrency() {
   return (`${this. name} (${this.code})`);
  }
}
